import React, { useState } from 'react'
import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
  LogoutOutlined,
  DashboardOutlined
} from '@ant-design/icons';
import '../../custom.css'
const { Header, Sider, Content } = Layout;

function AdminArea({ adminType }) {

  const [showSlider, setshowSlider] = useState(false);
  const toggleSlider = () => {
    setshowSlider(!showSlider);
  }

  return (
    <>
      <Sider trigger={null} collapsible collapsed={showSlider} style={{ marginTop: '4rem' }}>
        <Menu theme="dark" mode="inline">
          <Menu.Item onClick={toggleSlider}>
            {React.createElement(showSlider ? (MenuUnfoldOutlined) : MenuFoldOutlined, {
              className: 'trigger',

            })}<span>Menu </span>
          </Menu.Item>
          <Menu.Item key="1" icon={<DashboardOutlined />}>
           Dashboard
          </Menu.Item>
          <Menu.Item key="2" icon={<VideoCameraOutlined />}>
            View All 
          </Menu.Item>
          <Menu.Item key="3" icon={<UploadOutlined />}>
          
          </Menu.Item>

          <Menu.Item style={{bottom:'0px'}} key="4" icon={<LogoutOutlined />}>
            Logout
          </Menu.Item>
        </Menu>
          
      </Sider>
      <Content
        className="site-layout-background"
        style={{
          marginTop: '3rem',
          padding: '1rem',
          minHeight: '100vh',
        }}>


        <h1>Admin area</h1>
        <h1>{adminType}</h1>


      </Content>
    </>
  )
}

export default AdminArea
